import React from "react";

import Header from "./components/Header";
import Opening from "./components/Opening";
import Carousel from "./components/Carousel";
import Sectionto from "./components/Sectionto";

function App() {
  return (
    <div className="App">
        <Header/>
        <Opening/>
        <Carousel/>
        <Sectionto/>
        <Footer/>
    </div>
  );
}

export default App;
